import "./App.css";
import { CheckList } from "./components/CheckList";

function App() {

  const [kind, setKind] = useState("");

  return (
    <div className="mainContainer">
      <div className="mainTopButtons">
        <button onClick={()=>setKind("first")}>first</button>
        <button onClick={()=>setKind("second")}>second</button>
        <button onClick={()=>setKind("third")}>third</button>
      </div>
      <CheckList />
    </div>
  );
}

export default App;
